  return (
    <div className="App">
      <Router>
        <Link to="createpost">Create a post</Link>
        <Routes>
          {/* `element` özelliği ile Home bileşenini çağırıyoruz */}
          <Route path="/" exac element={<Home />} />
          <Route path="/createpost" element={<Home />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
